 Snake game code

// Set up canvas
let canvas = document.getElementById(""canvas"");
let ctx = canvas.getContext(""2d"");

// Set up game variables
let snake;
let snakeSize = 10;
let food;
let score;

// Set up game objects
function Snake() {
    this.x = 0;
    this.y = 0;
    this.xSpeed = snakeSize;
    this.ySpeed = 0;
    this.total = 0;
    this.tail = [];

    this.draw = function() {
        ctx.fillStyle = ""#FFFFFF"";
        for (let i=0; i<this.tail.length; i++) {
            ctx.fillRect(this.tail[i].x, this.tail[i].y, snakeSize, snakeSize);
        }
        ctx.fillRect(this.x, this.y, snakeSize, snakeSize);
    }

    this.update = function() {
        for (let i=0; i<this.tail.length - 1; i++) {
            this.tail[i] = this.tail[i+1];
        }
        this.tail[this.total - 1] = { x: this.x, y: this.y };

        this.x += this.xSpeed;
        this.y += this.ySpeed;

        if (this.x > canvas.width) {
            this.x = 0;
        }
        if (this.y > canvas.height) {
            this.y = 0;
        }
        if (this.x < 0) {
            this.x = canvas.width;
        }
        if (this.y < 0) {
            this.y = canvas.height;
        }
    }

    this.changeDirection = function(direction) {
        switch(direction) {
            case 'Up':
                this.xSpeed = 0;
                this.ySpeed = -snakeSize;
                break;
            case 'Down':
                this.xSpeed = 0;
                this.ySpeed = snakeSize;
                break;
            case 'Left':
                this.xSpeed = -snakeSize;
                this.ySpeed = 0;
                break;
            case 'Right':
                this.xSpeed = snakeSize;
                this.ySpeed = 0;
                break;
        }
    }

    this.eat = function(food) {
        if (this.x === food.x && this.y === food.y) {
            this.total++;
            return true;
        }
        return false;
    }
}

function Food() {
    this.x;
    this.y;

    this.pickLocation = function() {
        this.x = (Math.floor(Math.random() * (canvas.width / snakeSize))) * snakeSize;
        this.y = (Math.floor(Math.random() * (canvas.height / snakeSize))) * snakeSize;
    }

    this.draw = function() {
        ctx.fillStyle = ""#FF0000"";
        ctx.fillRect(this.x, this.y, snakeSize, snakeSize);
    }
}

// Set up game functions
function init() {
    snake = new Snake();
    food = new Food();
    score = 0;

    food.pickLocation();

    window.setInterval(() => {
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        food.draw();
        snake.update();
        snake.draw();

        if (snake.eat(food)) {
            score++;
            food.pickLocation();
        }
    }, 100);
}

// Set up event listeners
window.addEventListener(""keydown"", ((evt) => {
    let direction = evt.key.replace('Arrow', '');
    snake.changeDirection(direction);
}));

// Start game
init();"

