func main() {
	// Membuat koneksi ke database
	db, err := sql.Open(""mysql"", ""root:password@tcp(127.0.0.1:3306)/db_mahasiswa"")
	if err != nil {
		panic(err.Error())
	}
	defer db.Close()

	// Mempersiapkan data
	nim := ""12345""
	nama := ""John Doe""
	jurusan := ""Teknik Informatika""

	// Membuat query untuk menyimpan data
	stmt, err := db.Prepare(""INSERT INTO mahasiswa (nim, nama, jurusan) VALUES(?,?,?)"")
	if err != nil {
		panic(err.Error())
	}
	defer stmt.Close()

	// Menjalankan query
	_, err = stmt.Exec(nim, nama, jurusan)
	if err != nil {
		panic(err.Error())
	}

	fmt.Println(""Data berhasil disimpan!"")
}"

