    for (i = 0; i < n; i++)
    {
        for (j = 0; j < n; j++)
        {
            magic_square[i][j] = 0;
        }
    }

    // set the initial position
    i = 0;
    j = n / 2;
    magic_square[i][j] = 1;

    // generate the magic square
    for (int num = 2; num <= n * n; num++)
    {
        int next_i = (i - 1 + n) % n;
        int next_j = (j + 1) % n;

        if (magic_square[next_i][next_j] != 0)
        {
            next_i = (i + 1) % n;
            next_j = j;
        }

        i = next_i;
        j = next_j;
        magic_square[i][j] = num;
