package com.android.settings.notification;

import android.app.NotificationManager;
import android.content.Context;
import android.os.UserHandle;
import android.provider.Settings;
import android.support.v7.preference.Preference;
import android.support.v7.preference.PreferenceScreen;

import com.android.settings.R;
import com.android.settings.core.PreferenceControllerMixin;
import com.android.settingslib.core.AbstractPreferenceController;

public class ZenModeSettingsFooterPreferenceController extends AbstractPreferenceController
        implements PreferenceControllerMixin {

    private static final String KEY_ZEN_MODE_SETTINGS_FOOTER = ""zen_mode_settings_footer"";

    private final NotificationManager mNoMan;
    private final int mUserId;

    public ZenModeSettingsFooterPreferenceController(Context context) {
        super(context);
        mNoMan = context.getSystemService(NotificationManager.class);
        mUserId = UserHandle.myUserId();
    }

    @Override
    public boolean isAvailable() {
        return true;
    }

    @Override
    public String getPreferenceKey() {
        return KEY_ZEN_MODE_SETTINGS_FOOTER;
    }

    @Override
    public void displayPreference(PreferenceScreen screen) {
        super.displayPreference(screen);
        final Preference pref = screen.findPreference(KEY_ZEN_MODE_SETTINGS_FOOTER);
        if (pref != null) {
            final boolean enabled = Settings.Secure.getInt(mContext.getContentResolver(),
                    Settings.Secure.ZEN_SETTINGS_SUGGESTION_VIEWED, 0) != 0;
            pref.setSummary(enabled ? R.string.zen_mode_settings_suggestion_complete
                    : R.string.zen_mode_settings_suggestion);
        }
    }
